    true,nt"url": null,nt"notes": "In 2006, the U.S. Department of Housing
    and Urban Development (HUD) began acquiring quarterly extracts of U.S. Postal Service
    (USPS) data and publishing this data as a possible indicator of blight and vacancy
    for cities nationwide. In this report, addresses coded as u201cnou2013statu201d
    in the HUD data are used as proxies for blighted housing units in New Orleans because
    a parcelu2013byu2013parcel census of all properties in New Orleans is not available.
